import React from 'react';
import logo from '../assets/logo.png';
import styles from './NavBar.module.css';

export function NavBar(){

    return (
        <div className={styles['nav-bar']}>
            <img src = {logo} className={styles.logo} alt="belb_logo"></img>
        </div>
    );
}
